import React from 'react';

class Main extends React.Component{
    render(){
        return(
        <div className="App-header">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12 offset-lg-0 my-5">
                        <h1>
                            <b>The Business Model</b>
                        </h1>
                        <h2>
                            The MSME will give out a paper consisting of the purpose of the loan, Justifying the amount of loan and its tenure.
                            The document along with the financial data of the MSME will be shown to the investors for a period of 30 days.
                            The investors can give the funds in the form of crowdfunding to the MSME.The MSME can also decide the installment in which they want the loans.
                            Upon the day of installment the MSME have to release their financial data once again which will be shown to the investors. Upon voting if the investor find the data satisfactory the amount will be transferred to the MSME.
                            The details of the audit report will be given by auditors which will be assigned by us.
                        </h2>
                    </div>
                </div>
            </div>
        </div>
        )
    }
}
export default Main;
